func TestGetTemperatureAndChartNoError(t *testing.T) {
	mockSender, service := setUpWeatherServiceTest()

	mockSender.On("SendGetRequest", mock.Anything).Return([]byte(
		`{
    		"average_temperature": 25.50,
    		"chart": "base64Code"
		 }`,
	), nil)

	weatherData := getMockedWeatherData()
	avrgTemp, chartBase64, err := service.GetTemperatureAndChart(weatherData)

	assert.NoError(t, err)
	assert.Equal(t, 25.50, avrgTemp)
	assert.Equal(t, "base64Code", chartBase64)
}

func TestGetTemperatureAndChartReturnError(t *testing.T) {
	mockSender, service := setUpWeatherServiceTest()

	mockSender.On("SendGetRequest", mock.Anything).Return(nil, errors.New("some error"))

	weatherData := getMockedWeatherData()
	avrgTemp, chartBase64, err := service.GetTemperatureAndChart(weatherData)

	assert.Error(t, err)
	assert.Zero(t, avrgTemp)
	assert.Zero(t, chartBase64)
}

