func TestGetWeatherPredictionMessageReturnError(t *testing.T) {
	mockSender, service := setUpWeatherServiceTest()

	mockSender.On("SendGetRequest", mock.Anything).Return(nil, errors.New("some error"))

	weatherData := getMockedWeatherData()
	result, err := service.GetWeatherPredictionMessage(weatherData, 123)

	assert.Error(t, err)
	assert.Nil(t, result)
}

func TestGetDateFormatted(t *testing.T) {
	_, service := setUpWeatherServiceTest()

	testTime := time.Date(2022, time.February, 20, 15, 30, 0, 0, time.UTC)
	formattedDate := service.GetDateFormatted(testTime)

	assert.Equal(t, "2022-02-20", formattedDate)
}

func setUpWeatherServiceTest() (*mocks.MockSender, services.WeatherPredictorService) {
	mockSender := new(mocks.MockSender)
	log := models.GetNewLogger()
	service := services.NewWeatherPredictorService("dummy-url", mockSender, log)
	return mockSender, service
}

func getMockedWeatherData() models.WeatherData {
	return models.WeatherData{
		City:    "TestCity",
		Country: "TestCountry",
		Date:    time.Now(),
		Coordinates: models.Coordinates{
			Lat: "10.0",
			Lon: "20.0",
		},
	}
}
